import {
    FiType,
    FiLogIn,
    FiLogOut,
    FiHash,
    FiCheckCircle,
    FiGlobe,
    FiShuffle,
    FiClock,
    FiFileText,
  } from "react-icons/fi";

  export const Toolbar = ({ onAddNode }) => {

    const nodes = [
      { type: 'text', label: 'Text', icon: <FiType size={18} /> },
      { type: 'input', label: 'Input', icon: <FiLogIn size={18} /> },
      { type: 'output', label: 'Output', icon: <FiLogOut size={18} /> },
      { type: 'number', label: 'Number', icon: <FiHash size={18} /> },
      { type: 'boolean', label: 'Boolean', icon: <FiCheckCircle size={18} /> },
      { type: 'api', label: 'API', icon: <FiGlobe size={18} /> },
      { type: 'condition', label: 'Condition', icon: <FiShuffle size={18} /> },
      { type: 'delay', label: 'Delay', icon: <FiClock size={18} /> },
      { type: 'logger', label: 'Logger', icon: <FiFileText size={18} /> },
    ];

    return (
      <div style={styles.toolbar}>
        {nodes.map((node) => (
          <button
            key={node.type}
            style={styles.button}
            onClick={() => onAddNode(node.type)}
          >
            {node.icon}
            <span>{node.label}</span>
          </button>
        ))}
      </div>
    );
  };

  const styles = {
    toolbar: {
      display: 'grid',
      gridTemplateColumns: 'repeat(3, 1fr)',
      gap: '12px',
      padding: '12px',
      borderBottom: '1px solid #e5e7eb',
      background: '#f8fafc',
    },
    button: {
      display: 'flex',
      alignItems: 'center',
      gap: '8px',
      padding: '10px',
      borderRadius: '8px',
      border: '1px solid #e5e7eb',
      background: '#ffffff',
      cursor: 'pointer',
      fontWeight: 600,
      fontSize: '13px',
      transition: '0.2s ease',
    },
  };
